import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <div className="flex justify-between item-center h-24 max-w-[1240px] mx-auto px-4">
        <h1 className="w-full text-3x1 font-bold">MERN</h1>
        <ul>
          <li>
            {" "}
            <Link to={`deptList`}>Department</Link>
          </li>
          <li>
            {" "}
            <Link to={`salaryList`}>Salary</Link>
          </li>
        </ul>
      </div>
    </header>
  );
};

export default Navbar;
